import logo from "./logo.svg";
import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    let radioStations = [
      "balamii",
      "CashmereRadio",
      "dazed",
      "hotelradioparis",
    ];

    let mixes = [];
    let mix = {}
  }

  componentDidMount() {
    try {
      const response = fetch(`https://api.mixcloud.com/balamii/cloudcasts/`)
        .then(res => res.json())
        .then((result) =>{
          const {data} = result
          // console.log(data);
          this.display(data[0])
        })
    } catch (error) {
      console.log(error);
    }
  }

  display = (mix) => {
    const {name, url} = mix
    mix.name = name
    mix.url = url
    radioStations[0]
  }

  mixList = (mix) => {
    mixes.push(mix)
  }



  render() {
    return (
      <div className="App" onLoad={this.searchMixes}>
        <h1>Hi</h1>
      </div>
    );
  }
}

export default App;
